import './Experience.css';
import { Card } from '../components/Card';

const Entry = (children) =>{
    {children}
};

export default function Experience() {
    return (
        <div className='experience'>
            <div className='experience-container'>
                <h1> Experience</h1>
                <div className='experience-cards'>
                    <Card>
                        PlayStation (SIE)
                    </Card>
                    <Card>
                        Cisco
                    </Card>
                </div>
            </div>
        </div>
    );
}
